def min_cost(cost, m, n):
    # Initialize a 2D array to store the minimum cost to reach each cell
    min_cost_table = [[0 for _ in range(n + 1)] for _ in range(m + 1)]

    # Populate the first row and column of the table with the costs from the cost matrix
    for i in range(1, m + 1):
        min_cost_table[i][0] = cost[i - 1][0]
    for j in range(1, n + 1):
        min_cost_table[0][j] = cost[0][j - 1]

    # Iterate over the remaining cells in the table
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            # Calculate the minimum cost to reach the current cell
            min_cost_table[i][j] = cost[i - 1][j - 1] + min(min_cost_table[i - 1][j], min_cost_table[i][j - 1])

    # Return the minimum cost to reach the bottom-right corner of the table
    return min_cost_table[m][n]

