def count_ways(n):
    """
    Given a 3 x n board, find the number of ways to fill it with 2 x 1 dominoes.
    """
    if n <= 0:
        return 0

    # Base cases:
    if n == 1:
        return 1
    if n == 2:
        return 2

    # Recursive case:
    # If we place a vertical domino, we have count_ways(n - 1) options for the remaining space.
    # If we place a horizontal domino, we have count_ways(n - 2) options for the remaining space.
    return count_ways(n - 1) + count_ways(n - 2)

