def odd_Equivalent(s, n):
    # Count the number of odd digits
    odd_count = 0
    for i in range(n):
        if int(s[i]) % 2 == 1:
            odd_count += 1

    # If the number of odd digits is even, then the string is already odd-equivalent
    if odd_count % 2 == 0:
        return 0

    # Otherwise, we need to find the minimum number of rotations to make the string odd-equivalent
    min_rotations = n

    # Try all possible rotations
    for i in range(1, n):
        # Rotate the string by i positions
        rotated_string = s[i:] + s[:i]

        # Count the number of odd digits in the rotated string
        odd_count = 0
        for j in range(n):
            if int(rotated_string[j]) % 2 == 1:
                odd_count += 1

        # If the number of odd digits in the rotated string is odd, then update the minimum number of rotations
        if odd_count % 2 == 1:
            min_rotations = min(min_rotations, i)

    # Return the minimum number of rotations
    return min_rotations

