def answer(L,R):
    """
    Finds two distinct numbers such that their lcm lies within the given range.

    Args:
    L: The lower bound of the range.
    R: The upper bound of the range.

    Returns:
    A tuple of two distinct numbers whose lcm lies within the given range, or None if no such numbers exist.
    """

    # If the range is too small, no such numbers exist.
    if R - L < 1:
        return None

    # Iterate over all pairs of numbers in the range.
    for i in range(L, R + 1):
        for j in range(i + 1, R + 1):
            # If the lcm of the pair is within the range, return the pair.
            if L <= i * j // math.gcd(i, j) <= R:
                return (i, j)

    # If no such numbers exist, return None.
    return None

