    """
    Finds the maximum sum of a bi-tonic sub-sequence in the given array.
    """
    # Initialize the forward and backward arrays
    forward = [0] * n
    backward = [0] * n

    # Calculate the forward array
    for i in range(n):
        for j in range(i):
            if arr[i] > arr[j] and forward[i] < forward[j] + arr[i]:
                forward[i] = forward[j] + arr[i]

    # Calculate the backward array
    for i in range(n - 1, -1, -1):
        for j in range(i + 1, n):
            if arr[i] > arr[j] and backward[i] < backward[j] + arr[i]:
                backward[i] = backward[j] + arr[i]

    # Find the maximum sum
