def modular_sum(arr, n, m):
    dp = [[False for _ in range(m)] for _ in range(n + 1)]

    # Initialization
    for i in range(n + 1):
        dp[i][0] = True

    for i in range(1, n + 1):
        for j in range(1, m):
            dp[i][j] = dp[i - 1][j]

            if arr[i - 1] <= j:
                dp[i][j] |= dp[i - 1][j - arr[i - 1]]

    return dp[n][m - 1]

