def find_kth(arr1, arr2, m, n, k):
    """
    Finds the kth element in two sorted arrays.

    Time Complexity: O(log(m + n))
    Space Complexity: O(1)

    Args:
        arr1 (list): The first sorted array.
        arr2 (list): The second sorted array.
        m (int): The length of the first array.
        n (int): The length of the second array.
        k (int): The index of the element to find.

    Returns:
        int: The kth element in the merged array.
    """

    # If either array is empty, return the element from the other array.
    if m == 0:
        return arr2[k - 1]
    if n == 0:
        return arr1[k - 1]

    # Find the midpoints of both arrays.
    mid1 = m // 2
    mid2 = n // 2

    # If the kth element is in the first half of the merged array, recursively call the function on the first halves of the arrays.
    if mid1 + mid2 < k:
        if arr1[mid1] < arr2[mid2]:
            return find_kth(arr1[mid1 + 1:], arr2, m - mid1 - 1, n, k - mid1 - 1)
        else:
            return find_kth(arr1, arr2[mid2 + 1:], m, n - mid2 - 1, k - mid2 - 1)

    # If the kth element is in the second half of the merged array, recursively call the function on the second halves of the arrays.
    else:
        if arr1[mid1] < arr2[mid2]:
            return find_kth(arr1, arr2, m, n - mid2 - 1, k)
        else:
            return find_kth(arr1[mid1 + 1:], arr2, m - mid1 - 1, n, k)

