def check_min_heap(arr, i):
    """
    Checks if the given array represents a min heap or not.
    """
    # Base case: if i is greater than or equal to the length of the array, then the array is a min heap.
    if i >= len(arr):
        return True

    # Recursive case: check if the current node follows the min heap property.
    # If the current node's value is greater than any of its children, then the array is not a min heap.
    if arr[i] > min(arr[2 * i + 1], arr[2 * i + 2]):
        return False

    # Recursively check the left and right subtrees.
    return check_min_heap(arr, 2 * i + 1) and check_min_heap(arr, 2 * i + 2)

