  """
  Checks if the given date is a valid Gregorian date.

  Args:
    m: The month of the date, as an integer from 1 to 12.
    d: The day of the month, as an integer from 1 to 31.
    y: The year of the date, as an integer.

  Returns:
    True if the date is valid, False otherwise.
  """

  # Check if the month is valid.
  if m < 1 or m > 12:
    return False

  # Check if the day is valid.
  if d < 1 or d > 31:
    return False

  # Check if the year is valid.
  if y < 1:
    return False

  # Check if the date is valid for the given month and year.
  if m == 2:
    # February has 29 days in leap years.
    if y % 4 == 0 and (y % 100 != 0 or y % 400 == 0):
      if d > 29:
        return False
    else:
      if d > 28:
        return False
  elif m in [4, 6, 9, 11]:
    # April, June, September, and November have 30 days.
    if d > 30:
      return False
  else:
    # All other months have 31 days.
    if d > 31:
      return False

  # The date is valid.
  return True

